import React, { Component } from 'react';
import {Box} from 'grommet';

class Header extends Component {
    render() {
        return (
          <Box direction='row' justify=''>
              <p>Header</p>
              <p>Header</p>
              <p>Header</p>
              <p>Header</p>
          </Box>   
        );
    }
}

export default Header;
